import "../../App.css";
import {
    Row,
    Col,
    Container,
    Button,
    Form,
  } from "react-bootstrap";

export function AccountBox(props) {
    return(
    <Row>
        <Col className="w-100">
        {/* <div className="boxContainer"> */}
            <div className="topContainer">
                <div className="backDrop w-100">
                    <div className="headerContainer">
                        <div className="headerText">
                            Login page
                        </div>
                    </div>
                </div>
            </div>
        {/* </div> */}
        </Col>
    </Row>
    )
}
